import React, {Component} from 'react';
import styled from 'styled-components'




class ProjectFilters extends Component{
    render(){
        return(
           <div>
               	<h2>Fitros</h2>
                <label>ID</label>
                <input type="text" placeholder="ID" aria-label="ID"></input>

           </div>
        )
    }
}

export default ProjectFilters
